import socket
from tkinter import*
from tkinter import filedialog
import threading
import base64
import os
import random
import time
import re

so = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
num = []
partec = {}
ip = ""
colors = ["#E98BC3", "#CD6155", "#68E551", "#2471A3","#27AE60","#D68910","#707B7C","#E59866"]
co = 0

def icon(win):
    a = ""
    b = a.encode("utf-8")
    with open("ico.ico","wb") as file:
        c = base64.decodebytes(b)
        file.write(c)
    win.iconbitmap("ico.ico")
    os.remove("ico.ico")
def istr():
    file = ""
    b = file.encode("utf-8")
    with open("Istruzioni.txt","wb") as file:
        c = base64.decodebytes(b)
        file.write(c)



class pag_ini():
    def __init__(self):
        self.hst()
    def hst(self):
        self.win = Tk()
        self.win.geometry("300x185")
        self.win.resizable(False,False)
        self.win.title("HideChat")
        icon(self.win)
        self.win.config(bg = "black")
        lab = Label(self.win,text = "Inserisci l'hostname", font = ("Courier",14,), bg = "black", fg = "#00ff00")
        lab.place(relx = 0.5,anchor=CENTER, y = 30)
        self.en = Entry(self.win, borderwidth = 0, width = 23, font = ("Courier",14),bg = "#2F3033", fg = "#C2C2C2")
        self.en.place(relx = 0.5, anchor = CENTER, y = 60)
        bu = Button(self.win, text = "OK!",command = lambda: self.coll(self.en.get()),font = ("Courier",14,), bg = "#2F3033", fg = "#00ff00", borderwidth = 1, relief = SOLID,width = 23)
        bu.place(relx = 0.5, anchor = CENTER, y = 120)
        self.en.bind("<Return>", self.invio)
    def invio(self, event):
        self.coll(self.en.get())
    def coll(self, name):
        try:
            global ip
            self.win.destroy()
            so.connect((name, 8000))
            ip = name
            schemata_principale()
        except:
            self.hst()
        
class schemata_principale():
    def __init__(self):
        self.accesso()
    def accesso(self):
        self.win = Tk()
        icon(self.win)
        self.win.geometry("300x200")
        self.win.resizable(False,False)
        self.win.title("HideChat")
        self.win.config(bg = "black")
        lab = Label(self.win,text = "Inserisci username:", font = ("Courier",14,), bg = "black", fg = "#00ff00")
        lab.place(relx = 0.5,anchor=CENTER, y = 30)
        self.en = Entry(self.win, borderwidth = 0, width = 23, font = ("Courier",14),bg = "#2F3033",fg = "#C2C2C2")
        self.en.place(relx = 0.5, anchor = CENTER, y = 60)
        bu = Button(self.win, text = "OK!",command = lambda: self.send_acc(self.en.get()),font = ("Courier",14,), bg = "#2F3033", fg = "#00ff00", borderwidth = 1, relief = SOLID,width = 23)
        bu.place(relx = 0.5, anchor = CENTER, y = 120)
        self.win.protocol("WM_DELETE_WINDOW", self.win.destroy)
        self.en.bind("<Return>", self.invio)
    def invio(self, event):
        self.send_acc(self.en.get())
    def send_acc(self, nome):
        if nome != "":
            if not re.findall("[ -/-:-@-[-^-{-⁓]",nome):
                so.sendall(bytes("!!iscr##" + nome + "<--[°+°]-->","utf-8"))
                data = so.recv(4096)
                mess = data.decode()
                if mess == "!!ok##":
                    self.win.destroy()
                    accesso_eseguito(nome)
                elif mess == "!!ban##":
                    self.err_avv("*sei stato bannato*")
                else:
                    self.err_avv("*username già in uso!*")
            else:
                self.err_avv("*username non valido!*")
    def err_avv(self, mess):
        te = Label(text = mess, bg = "black", fg = "#00ff00",font = ("Courier",12))
        te.place(relx = 0.5, anchor = CENTER, y = 160)
        self.win.after(3000, te.destroy)
        self.en.delete(0,END)

class accesso_eseguito():
    def __init__(self, nome):
        self.win = Tk()
        self.win.attributes('-topmost', True)
        icon(self.win)
        self.win.geometry("250x300")
        self.win.resizable(False,False)
        self.win.title("HideChat - " + nome)
        self.win.config(bg = "black")
        self.win.protocol("WM_DELETE_WINDOW", self.chiusura)
        self.menu()
        self.nome = nome
        self.scrive = True
        self.new = True
        tt = self.Comunicazione()
        tt.start()
        self.lettura()
    def menu(self):
        self.scrollbar = Scrollbar(self.win)
        aa = Frame(self.win, bg = "black", height = 50)
        aa.pack(side = BOTTOM, fill = X)
        self.text = Text(aa,highlightthickness = 0,yscrollcommand=self.scrollbar.set,height = 15,width = 30, bg = "black",borderwidth = 1,relief = SOLID)
        self.text.pack(side = TOP)
        self.en = Entry(aa, borderwidth = 0, width = 30, font = ("Courier",13),bg = "#2F3033", fg = "#C2C2C2")
        self.en.pack(side = BOTTOM, fill = X)
        self.text.config(state = DISABLED)
        self.scrollbar.config(command=self.text.yview)
        #popupmenucopy
        self.menu_c = Menu(self.win,tearoff = 0,font = ("Courier",10), background="black",borderwidth=0,activebackground = "#898E87", fg = "white")
        self.benvenuto()
        self.menu_c.add_cascade(label = "Copia", command = self.copy_text)
        self.en.bind("<Return>", self.send_mes)
        self.en.bind("<Key>", self.sta_scrive)
        self.text.bind("<MouseWheel>", self.fine_new_mess)
        self.win.bind("<Button-3>", self.win_copy)

    def benvenuto(self):
        self.inserti(">> Benvenuto nella chat!","ben","#FFD700",None)
        self.inserti(">> Se sei nuovo digita !info","ben","#FFD700",None)
        self.inserti(">> e ti verrà scaricato il","ben","#FFD700",None)
        self.inserti(">> file con le istruzioni." + "\n","ben","#FFD700",None)
    def win_copy(self, event):
        self.menu_c.post(event.x_root, event.y_root)
    def copy_text(self):
        self.text.clipboard_clear()
        self.text.clipboard_append(self.text.selection_get())
    def text_see(self):
        if self.scrollbar.get()[1] >= 0.99:
            self.text.see(END)
            self.new = True
    def new_mess(self):
        if self.scrollbar.get()[1] < 0.99 and self.new == True:
            self.new = False
            self.inserti("\n" + "▼    messaggi non letti    ▼" + "\n","new","#EE497D","center")
        self.fine_new_mess(None)
    def fine_new_mess(self, event):
        if self.scrollbar.get()[1] >= 0.99 and self.new == False:
            self.inserti("\n" + "          ───────          " + "\n","new","#EE497D","center")
            self.text.see(END)
            self.new = True
    def inserti(self, mess, tag, color,jus):
        self.text.tag_config(tag,  foreground=color, justify = jus)
        self.text.config(state = NORMAL)
        self.text.insert(END, mess + "\n",tag)
        self.text.config(state = DISABLED)
    def send_mes(self, event):
        if self.en.get() != "":
            if self.en.get().replace(" ","")[0:8] == "!sendall":
                self.sendall_file()
            elif self.en.get().replace(" ","") == "!partec":
                self.mostra_partec()
            elif self.en.get().replace(" ","")[0:5] == "!send":
                self.send_file()
            elif self.en.get().replace(" ","") == "!info":
                istr()
            else: 
                so.sendall(bytes("!!mess##" + self.en.get() + "<--[°+°]-->","utf-8"))
                self.new_mess()
                self.inserti("Tu> " + self.en.get(),"utente","white",None)
                self.text_see()
        self.en.delete(0, END)
    def send_file(self):
        mess = self.en.get().replace(" ","")
        des = mess.replace("!send","")
        if des != self.nome:
            if des in partec:
                dire = filedialog.askopenfilename()
                if dire != "":
                    if os.path.isfile(dire):
                        so.sendall(bytes("##okdes!!" + des + "§" + self.nome + "§" + dire + "<--[°+°]-->","utf-8"))
                        self.caricamento_file(">> trasferimento file...")
                    else:
                        self.caricamento_file(">> file non esistente!")
            else:
                self.caricamento_file(">> utente non esistente!")
    def sendall_file(self):
        if len(partec) > 1:
            dire = filedialog.askopenfilename()
            if dire != "":
                if os.path.isfile(dire):
                    for des in partec:
                        if des != self.nome:
                            so.sendall(bytes("##okdes!!" + des + "§" + self.nome + "§" + dire + "<--[°+°]-->","utf-8"))
                            self.caricamento_file(">> trasferimento file...")
                else:
                    self.caricamento_file(">> file non esistente!")
    def mostra_partec(self):
        for x in partec:
            if x == self.nome:
                x = x + " (Tu)"
            self.new_mess()
            self.inserti(">> " + x,"par","#22D29F",None)
            self.text_see()
    def asse_color_partec(self, nome):
        global co
        if co < 8:    
            partec[nome] = colors[co]
            co += 1
        else:
            co = 0
            partec[nome] = colors[co]

    def spacc_mess(self, msg):
        msg = msg.replace("##mess!!","")
        numo = msg.find("§",1)
        nome = msg[0:numo]
        mess = msg.replace(nome + "§","")
        self.new_mess()
        self.inserti(nome + "> " + mess,nome,partec[nome],None)
        self.text_see()
    def sta_scrive(self, event):
        if self.scrive == True:
            so.sendall(bytes("!!sta_scrive##" + "<--[°+°]-->", "utf-8"))
            self.scrive = False
            self.win.after(1000, self.scrive_reset)
    def scrive_reset(self):
        self.scrive = True
    def sta_scrive_insert(self, mess):
        mess = mess.replace("##sta_scrive!!","")
        tes = "*" + mess + " sta scrivendo*"
        lab = Label(self.win, text = tes,bg = "black", fg = "#00ff00",font = ("Courier",10))
        lab.place(relx = 0.5, anchor = CENTER, y = 20)
        self.win.after(2000, lab.destroy)
    def join(self, mess):
        mess = mess.replace("##join!!","")
        self.new_mess()
        self.inserti(">> " + mess + " join the chat","join","#C72DE5",None)
        self.text_see()
        self.asse_color_partec(mess)
    def left(self, mess):
        mess = mess.replace("##left!!","")
        self.new_mess()
        self.inserti(">> " + mess + " left the chat","left","#DC2B2B",None)
        self.text_see()
        del partec[mess]
    def parteci(self, mess):
        mess = mess.replace("##partec!!","")
        self.asse_color_partec(mess)
    def file_conn_des(self,mess):
        mitt = mess.replace("##okdes!!","")[0:mess.replace("##okdes!!","").find("§")]
        dire = mess.replace("##okdes!!" + mitt + "§","")
        des = str(random.randrange(1000000, 10000000000))
        tt = self.file_receiver(dire, des, mitt)
        tt.start()
    def file_conn_mitt(self,mess):
        des = mess.replace("##okmitt!!","")[0:mess.replace("##okmitt!!","").find("§")]
        dire = mess.replace("##okmitt!!" + des + "§","")
        tt = self.file_sender(des, dire)
        tt.start()
    def caricamento_file(self, mess):
        self.new_mess()
        self.inserti(mess,"blue","#2272D2",None)
        self.text_see()
    def lettura(self):
        try:
            mess = num.pop(0)
            if mess[0:8] == "##mess!!":
                self.spacc_mess(mess)
            if mess[0:14] == "##sta_scrive!!":
                self.sta_scrive_insert(mess)
            if mess[0:7] == "!!ban##":
                self.chiusura()
            if mess[0:8] == "##join!!":
                self.join(mess)
            if mess[0:8] == "##left!!":
                self.left(mess)
            if mess[0:10] == "##partec!!":
                self.parteci(mess)
            if mess[0:9] == "##okdes!!":
                self.file_conn_des(mess)
            if mess[0:10] == "##okmitt!!":
                self.file_conn_mitt(mess)
            if mess[0:12] == "!!finito_car":
                self.caricamento_file(">> completato!")
            if mess[0:5] == "!ohoh":
                self.caricamento_file(">> errore!")
            if mess[0:8] == "!carfile":
                self.caricamento_file(">> file in arrivo...")
            if mess[0:8] == "!ricfile":
                self.caricamento_file(">> file ricevuto!")
            if mess[0:8] == "!attfile":
                self.caricamento_file(">> elaborazione attendere...")
            if mess[0:9] == "!compfile":
                self.caricamento_file(">> elaborazione completata!")
        except:
            None
        self.win.after(10, self.lettura)
    def chiusura(self):
        self.win.destroy()
        so.close()
    class Comunicazione(threading.Thread):
        def __init__(self):
            threading.Thread.__init__(self) 
        def run(self):
            try:
                while True:      
                    data = so.recv(4096)
                    mess = data.decode()
                    while mess != "":
                        mes = mess.find("<--[°+°]-->",1)
                        bb = mess[0:mes]
                        mess = mess.replace(mess[0:mes] + "<--[°+°]-->","",1)
                        num.append(bb)
            except:
                None
    class file_sender(threading.Thread):
        def __init__(self, nome, dire):
            threading.Thread.__init__(self)
            self.dire = dire
            self.nome = nome
        def run(self):
            try:
                sso = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
                sso.connect((ip, 1234))
                sso.sendall(bytes("!mitt" + self.nome,"utf-8"))
                time.sleep(1)
                with open(self.dire, "rb") as file:
                    rd = True
                    while rd:
                        rd = file.read(3000)
                        bas = base64.b64encode(rd)
                        dec = bas.decode("utf-8")
                        sso.sendall(bytes(dec,"utf-8"))
                    time.sleep(5)
                    sso.sendall(bytes("!stop","utf-8"))
                    num.append("!!finito_car")
            except:
                num.append("!ohoh")   
            
    class file_receiver(threading.Thread):
        def __init__(self, dire, des, mitt):
            threading.Thread.__init__(self)
            self.dire = dire
            self.des = des
            self.mitt = mitt
        def run(self):
            try:
                sso = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
                sso.connect((ip, 1234))
                sso.sendall(bytes("!des" + self.des,"utf-8"))
                so.sendall(bytes("##okmitt!!" + self.mitt + "§" + self.des + "§" + self.dire + "<--[°+°]-->","utf-8"))
                num.append("!carfile")
                dowtxt = str(random.randrange(10000,10000000))
                with open(dowtxt + ".txt", "w") as file:
                    while True:
                        base64bytes = sso.recv(4096)
                        if base64bytes.decode()[0:5] == "!stop":
                            num.append("!ricfile")
                            break
                        else:
                            file.write(base64bytes.decode())
                num.append("!attfile")
                self.dire = os.path.split(self.dire)[1]
                with open(dowtxt + ".txt", "rb") as file:
                    with open(self.dire, "wb") as ko:
                        rd = True
                        while rd:
                            rd = file.read(4096)
                            base64decbytes = base64.decodebytes(rd)
                            ko.write(base64decbytes)
                os.remove(dowtxt + ".txt")
                num.append("!compfile")
            except:
                num.append("!ohoh")
pag_ini()
mainloop()